openapi: 3.0.3
info:
  title: 'Jump Into Job'
  description: ''
  version: 1.0.0
servers:
  -
    url: 'https://api.dev.jumpintojob.com'
paths:
  /api/v1/auth/user/login:
    post:
      summary: 'fields required: email, password, remember_me'
      operationId: fieldsRequiredEmailPasswordRememberMe
      description: ''
      parameters: []
      responses:
        401:
          description: ''
          content:
            application/json:
              schema:
                type: object
                example:
                  result: false
                  message: 'User not found'
                  user: null
                properties:
                  result:
                    type: boolean
                    example: false
                  message:
                    type: string
                    example: 'User not found'
                  user:
                    type: string
                    example: null
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                email:
                  type: string
                  description: 'Must be a valid email address.'
                  example: davis.leone@example.com
                password:
                  type: string
                  description: 'Must be at least 6 characters.'
                  example: 'V<{$k,'
                remember_me:
                  type: boolean
                  description: ''
                  example: true
              required:
                - email
                - password
      security: []
  /api/v1/auth/job-seeker/signup:
    post:
      summary: "new user sign up endpoint\nparams: first_name, last_name, email, password, password_confirmation, register_by, g-recaptcha-response"
      operationId: newUserSignUpEndpointparamsFirstNameLastNameEmailPasswordPasswordConfirmationRegisterByGRecaptchaResponse
      description: ''
      parameters: []
      responses:
        422:
          description: ''
          content:
            application/json:
              schema:
                type: object
                example:
                  message: 'Password confirmation does not match'
                  errors:
                    password:
                      - 'Password confirmation does not match'
                properties:
                  message:
                    type: string
                    example: 'Password confirmation does not match'
                  errors:
                    type: object
                    properties:
                      password:
                        type: array
                        example:
                          - 'Password confirmation does not match'
                        items:
                          type: string
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                first_name:
                  type: string
                  description: ''
                  example: suscipit
                last_name:
                  type: string
                  description: ''
                  example: eos
                password:
                  type: string
                  description: ''
                  example: voluptatem
                user_type:
                  type: string
                  description: ''
                  example: job_seeker
                  enum:
                    - job_seeker
                email:
                  type: string
                  description: 'This field is required when <code>register_by</code> is <code>email</code>.'
                  example: null
                verification_code:
                  type: string
                  description: ''
                  example: null
                user_plan_id:
                  type: string
                  description: ''
                  example: null
                new_email_verification_code:
                  type: string
                  description: ''
                  example: null
                referral_code:
                  type: string
                  description: ''
                  example: null
                g-recaptcha-response:
                  type: string
                  description: ''
                  example: null
              required:
                - first_name
                - last_name
                - password
      security: []
  /api/v1/auth/employer/signup:
    post:
      summary: "new user sign up endpoint\nparams: first_name, last_name, email, password, password_confirmation, register_by, g-recaptcha-response"
      operationId: newUserSignUpEndpointparamsFirstNameLastNameEmailPasswordPasswordConfirmationRegisterByGRecaptchaResponse
      description: ''
      parameters: []
      responses:
        422:
          description: ''
          content:
            application/json:
              schema:
                type: object
                example:
                  message: 'Minimum 6 digits required for password (and 1 more error)'
                  errors:
                    password:
                      - 'Minimum 6 digits required for password'
                      - 'Password confirmation does not match'
                properties:
                  message:
                    type: string
                    example: 'Minimum 6 digits required for password (and 1 more error)'
                  errors:
                    type: object
                    properties:
                      password:
                        type: array
                        example:
                          - 'Minimum 6 digits required for password'
                          - 'Password confirmation does not match'
                        items:
                          type: string
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                first_name:
                  type: string
                  description: ''
                  example: null
                last_name:
                  type: string
                  description: ''
                  example: null
                name:
                  type: string
                  description: ''
                  example: odio
                slug:
                  type: string
                  description: ''
                  example: iusto
                company_type:
                  type: string
                  description: ''
                  example: deleniti
                password:
                  type: string
                  description: ''
                  example: quasi
                user_type:
                  type: string
                  description: ''
                  example: employer
                  enum:
                    - employer
                email:
                  type: string
                  description: 'Must be a valid email address.'
                  example: brianne.ledner@example.org
                verification_code:
                  type: string
                  description: ''
                  example: null
                user_plan_id:
                  type: string
                  description: ''
                  example: null
                new_email_verification_code:
                  type: string
                  description: ''
                  example: null
                referral_code:
                  type: string
                  description: ''
                  example: null
                g-recaptcha-response:
                  type: string
                  description: ''
                  example: null
              required:
                - name
                - slug
                - company_type
                - password
                - email
      security: []
  /api/v1/auth/social-login:
    post:
      summary: ''
      operationId: postApiV1AuthSocialLogin
      description: ''
      parameters: []
      responses:
        200:
          description: ''
          content:
            application/json:
              schema:
                type: object
                example:
                  result: false
                  message: 'User not found'
                  user: null
                properties:
                  result:
                    type: boolean
                    example: false
                  message:
                    type: string
                    example: 'User not found'
                  user:
                    type: string
                    example: null
      tags:
        - Endpoints
      security: []
